import React from 'react';
import UploadResume from './components/UploadResume';
import Questions from './components/Questions';
import SubmitAnswers from './components/SubmitAnswers';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Mock Interview App</h1>

      {/* Upload Resume */}
      <UploadResume />

      <hr />

      {/* Show Questions */}
      <Questions />

      <hr />

      {/* Submit Answers */}
      <SubmitAnswers />
    </div>
  );
}

export default App;
